import Kiva from '../../images/kiva.svg';
import UNDP from '../../images/undp.svg';
import MakeAWish from '../../images/makeawish.svg';
import GlobalTassels from '../../images/globaltassels.svg';

const slides = [
    {
        "title": "KIVA",
        "description": "We envision a financially inclusive world where all people hold the power to improve their lives.",
        "image": Kiva,
        "link": 'https://www.kiva.org/'
    },
    {
        "title": "United Nations Devlopment Programme",
        "description": 'UNDP works in about 170 countries and territories, helping to achieve the eradication of poverty, and the reduction of inequalities and exclusion. We help countries to develop policies, leadership skills, partnering abilities, institutional capabilities "and build resilience in order to sustain development results.',
        "image": UNDP,
        'link': 'https://www.undp.org/content/undp/en/home.html'
    },
    {
        "title": 'Make-A-Wish America',
        "description": 'Together, we create life-changing wishes for children with critical illnesses.',
        "image": MakeAWish,
        'link': 'https://wish.org/'
    },
    {
        'title': 'Global Tassels',
        'description': 'We open doors to colleges and universities worldwide and we are committed to empowering our students to be leaders in their fields; engaging them in their communities; supporting their living sustainability, and shaping them to become the voices and forces of change for their countries.',
        "image": GlobalTassels,
        'link': 'http://globaltassels.org/'
    }
];

